backend.tf.code:
terraform {
  backend "s3" {
    bucket     = "cloud-ai-demo-infra"
    key        = "cloud-ai/cicd-agent.tfstate"
    region     = "us-east-1"
    encrypt    = true
    # Optionally enable DynamoDB for state locking
    # dynamodb_table = "my-lock-table"
  }
}

./module/vpc/main.tf.code:
resource "aws_vpc" "main" {
  cidr_block           = var.vpc_cidr
  enable_dns_hostnames = true
  enable_dns_support   = true

  tags = {
    Name = "cloud-ai-vpc"
  }
}

resource "aws_subnet" "public" {
  count                   = length(var.public_subnets_cidr)
  vpc_id                  = aws_vpc.main.id
  cidr_block              = var.public_subnets_cidr[count.index]
  map_public_ip_on_launch = true
  availability_zone       = element(var.azs, count.index)

  tags = {
    Name = "cloud-ai-public-subnet-${count.index}"
  }
}

resource "aws_internet_gateway" "igw" {
  vpc_id = aws_vpc.main.id

  tags = {
    Name = "cloud-ai-igw"
  }
}

resource "aws_route_table" "public" {
  vpc_id = aws_vpc.main.id

  route {
    cidr_block   = "0.0.0.0/0"
    gateway_id   = aws_internet_gateway.igw.id
  }

  tags = {
    Name = "cloud-ai-public-route-table"
  }
}

resource "aws_route_table_association" "public" {
  count          = length(aws_subnet.public)
  subnet_id      = aws_subnet.public[count.index].id
  route_table_id = aws_route_table.public.id
}

./module/vpc/variables.tf.code:
variable "vpc_cidr" {
  description = "CIDR block for the VPC"
  default     = "10.0.0.0/16"
}

variable "public_subnets_cidr" {
  description = "List of CIDR blocks for the public subnets"
  type        = list(string)
  default     = ["10.0.1.0/24", "10.0.2.0/24"]
}

variable "azs" {
  description = "List of availability zones in which to create subnets"
  type        = list(string)
  default     = ["us-east-1a", "us-east-1b"]
}

./module/vpc/outputs.tf.code:
output "vpc_id" {
  value = aws_vpc.main.id
}

output "public_subnets" {
  value = aws_subnet.public[*].id
}

./module/ec2/main.tf.code:
resource "aws_security_group" "ec2_sg" {
  name        = "cloud-ai-ec2-sg"
  description = "Security group for the EC2 instances in autoscaling group"
  vpc_id      = var.vpc_id

  ingress {
    from_port   = 80
    to_port     = 80
    protocol    = "tcp"
    cidr_blocks = ["0.0.0.0/0"]
  }

  egress {
    from_port   = 0
    to_port     = 0
    protocol    = "-1"
    cidr_blocks = ["0.0.0.0/0"]
  }
}

resource "aws_launch_configuration" "as_config" {
  name_prefix          = "cloud-ai-launch-config-"
  image_id             = var.ami_id
  instance_type        = var.instance_type
  security_groups      = [aws_security_group.ec2_sg.id]
  user_data_base64     = base64encode(var.userdata_script)

  lifecycle {
    create_before_destroy = true
  }
}

resource "aws_autoscaling_group" "as_group" {
  launch_configuration    = aws_launch_configuration.as_config.id
  vpc_zone_identifier     = var.subnets
  min_size                = var.autoscaling_min_size
  max_size                = var.autoscaling_max_size
  desired_capacity        = var.autoscaling_desired_capacity
  health_check_grace_period = 300
  health_check_type       = "ELB"
  tag {
    key                 = "Name"
    value               = "cloud-ai-ec2-instance"
    propagate_at_launch = true
  }
}

resource "aws_lb" "app_lb" {
  name               = "cloud-ai-app-lb"
  internal           = false
  load_balancer_type = "application"
  security_groups    = [aws_security_group.ec2_sg.id]
  subnets            = var.subnets

  enable_deletion_protection = false

  tags = {
    Name = "cloud-ai-app-lb"
  }
}

resource "aws_lb_target_group" "app_lb_tg" {
  name     = "cloud-ai-app-lb-tg"
  port     = 80
  protocol = "HTTP"
  vpc_id   = var.vpc_id
}

resource "aws_lb_listener" "app_lb_listener" {
  load_balancer_arn = aws_lb.app_lb.arn
  port              = 80
  protocol          = "HTTP"

  default_action {
    type             = "forward"
    target_group_arn = aws_lb_target_group.app_lb_tg.arn
  }
}

resource "aws_autoscaling_attachment" "as_lb_attachment" {
  autoscaling_group_name = aws_autoscaling_group.as_group.name
  lb_target_group_arn    = aws_lb_target_group.app_lb_tg.arn
}

./module/ec2/variables.tf.code:
variable "vpc_id" {
  description = "VPC ID where the resources will be deployed"
  type        = string
}

variable "subnets" {
  description = "List of subnet IDs for the autoscaling group and load balancer"
  type        = list(string)
}

variable "ami_id" {
  description = "The AMI ID to use for EC2 instances"
  default     = "ami-0b0ea68c435eb488d"
}

variable "instance_type" {
  description = "Instance type for EC2 instances"
  default     = "t2.micro"
}

variable "autoscaling_min_size" {
  description = "Minimum size of the autoscaling group"
  default     = 1
}

variable "autoscaling_max_size" {
  description = "Maximum size of the autoscaling group"
  default     = 3
}

variable "autoscaling_desired_capacity" {
  description = "Desired capacity of the autoscaling group"
  default     = 2
}

variable "userdata_script" {
  description = "User data script to initialize EC2 instances"
  default     = <<-EOF
                  #!/bin/bash
                  echo "Auto Deployment from Cloud-AI" > /var/www/html/index.html
                  EOF
}

./module/ec2/outputs.tf.code:
output "lb_dns_name" {
  description = "The DNS name of the load balancer"
  value       = aws_lb.app_lb.dns_name
}

output "asg_name" {
  description = "The autoscaling group name"
  value       = aws_autoscaling_group.as_group.name
}

./main.tf.code:
provider "aws" {
  region = var.aws_region
}

module "vpc" {
  source                       = "./module/vpc"
  vpc_cidr                     = var.vpc_cidr
  public_subnets_cidr          = var.public_subnets_cidr
  azs                          = var.azs
}

module "ec2" {
  source                       = "./module/ec2"
  vpc_id                       = module.vpc.vpc_id
  subnets                      = module.vpc.public_subnets
  ami_id                       = var.ami_id
  instance_type                = var.instance_type
  userdata_script              = var.userdata_script
  autoscaling_min_size         = var.autoscaling_min_size
  autoscaling_max_size         = var.autoscaling_max_size
  autoscaling_desired_capacity = var.autoscaling_desired_capacity
}

terraform {
  backend "s3" {
    bucket     = "cloud-ai-demo-infra"
    key        = "cloud-ai/cicd-agent.tfstate"
    region     = "us-east-1"
    encrypt    = true
  }
}

